<script type="text/javascript">
$('.submitcontact').click(function(){
    var form = $('.contactsupportform').serialize();
    $.ajax({
			url:"https://merafuture.pk/dashboard/sendcontact",
			method:"GET",
			dataType: 'json',
			data:form,
			success:function(data)
			{
					if(data.success)
					{
					    $('.displaymessage').html('<div class="lable label-success">'+data.message+'</div>');
					    $('.contactsupportform')[0].reset();
					    setTimeout(function(){
					        $('#myModalhelp').modal('hide');
					        $('.displaymessage').html('');
					    },2000)
					}else
					{
					    $('.displaymessage').html('<div class="lable label-danger">'+data.message+'</div>')
					}
					
                 
					
			}
		});	
})


$('.submitcontactdelivery').click(function(){
    var form = $('.cashdeliveryupportform').serialize();
    $.ajax({
			url:"https://merafuture.pk/dashboard/sendcontactdelivery",
			method:"GET",
			dataType: 'json',
			data:form,
			success:function(data)
			{
					if(data.success)
