<script type="text/javascript">
$('.selectpackage').click(function(){
    var amount = $(this).attr('data-amount');
    var title  = $(this).attr('data-text');
    $('.packageselected').show();
    $('.packagetitle').text(title);
    $('.packageamount').text(amount);
    $('.subtotal').text(amount);
    if(amount <= 1000)
    {
        var url = 'https://merafuture.pk/payment/index/'+amount+'/Test';
    }else
    {
        var url = 'https://merafuture.pk/payment/index/'+amount+'/Counseling';
    }
    
    $('.paymnenturl').attr('href',url)
})



$('.applydiscount').click(function(){
    var code = $('.discountcode').val();
    $.ajax({
			url:"https://merafuture.pk/dashboard/checkdiscount",
			method:"GET",
			dataType: 'json',
			data:{code : code},
			success:function(data)
			{
					if(data.success)
					{
					    $('.amountcode').html('<div class="lable label-success">'+data.message+'</div>');
					    $('.discountamount').show();
					    $('.amountcode').show();
					    $('.discountamountval').val(data.amount)
					    var packageamount = $('.packageamount').text();
					    var subtotal = packageamount-data.amount;
					    $('.subtotal').text(subtotal);
					    if(packageamount == 1000)
					    {
					        var url = 'https://merafuture.pk/payment/index/'+subtotal+'/Test/'+code;
					    }else
					    {
					        var url = 'https://merafuture.pk/payment/index/'+subtotal+'/Counseling/'+code;
					    }
					    $('.paymnenturl').attr('href',url)
					}else
					{
					    $('.amountcode').show();
					    $('.amountcode').html('<div class="lable label-danger">'+data.message+'</div>')
					}
					
                 
					
			}
		});	
})


$('.cashondelivery').click(function(){
    $('#myModaldelivery').modal('show');
    $('#paynowmodalbox').modal('hide');
    
})
$('.banktransfer').click(function(){
    $('#banktranfer').modal('show');
    $('#paynowmodalbox').modal('hide');
})
$('.easypaisabtn').click(function(){
    $('#easypaisa').modal('show');
    $('#paynowmodalbox').modal('hide');
})
</script>
