<script type="text/javascript">

	
$(document).ready(function(){
	var exam_id = "1";
    var category_id = "1";
    $(document).ready(function(){
    $.ajax({
							url:"https://merafuture.pk/asses/getcategoryinformation",
							method:"GET",
							dataType: 'json',
							data:{category_id:category_id},
							success:function(data)
							{
									$('.categoryinformation').html(data.description);
									
									$('#confirm-category').modal('show');
									$('.processbtn').attr('data-category',data.category_id)
									
                                    
                                 
									
							}
						});	
    })
    
	load_question();
	

	function load_question(question_id = '')
	{
		var getcategory = $('.category_id').val();
		
		$.ajax({
			url:"https://merafuture.pk/asses/getquestions",
			method:"GET",
			dataType : 'json',
			data:{exam_id:exam_id, question_id:question_id, page:'view_exam', action:'load_question',category_id:getcategory},
			success:function(data)
			{
				if(data.category != getcategory)
				{
					$('.category_id').val(data.category);
					$.ajax({
							url:"https://merafuture.pk/asses/getcategoryinformation",
							method:"GET",
							dataType: 'json',
							data:{category_id:data.category},
							success:function(data)
							{
									$('.categoryinformation').html(data.description);
									$('#confirm-category').modal('show');
								
                                    $('.processbtn').attr('data-category',data.category_id)
                                 
									
							}
						});	
						
					$('#confirm-category').modal('show');
					
                   
				}
					$('#single_question_area').html(data.questions);
					
					
					$('table.paginated').each(function() {
                            var currentPage = 0;
                            var numPerPage = 10;
                            var $table = $(this);
                            $table.bind('repaginate', function() {
                                $table.find('tbody tr').hide().slice(currentPage * numPerPage, (currentPage + 1) * numPerPage).show();
                                $('html, body').animate({scrollTop:0}, '300');
                                
                            });
                            $table.trigger('repaginate');
                            var numRows = $table.find('tbody tr').length;
                           
                            var numPages = Math.ceil(numRows / numPerPage);
                            
                            var $pager = $('<div class="pager"></div>');
                            for (var page = 0; page < numPages; page++) {
                                $('<span class="page-number"></span>').text(page + 1).bind('click', {
                                    newPage: page
                                }, function(event) {
                                    currentPage = event.data['newPage'];
                                    $table.trigger('repaginate');
                                    $(this).addClass('active').siblings().removeClass('active');
                                }).appendTo($pager).addClass('clickable');
                            }
                            $pager.insertAfter($table).find('span.page-number:first').addClass('active');
                        });
                        
					
					$('.buttonscod').html(data.buttons);
					var totalquestion = $('.valuequestion').text(); 
					var categoryquestion = '60';
					//alert(categoryquestion+'-'+totalquestion);
					if(totalquestion == categoryquestion)
        		    {
        		        $('.next').addClass('finish');
        		        $('.next').attr('id','');
        		        $('.next').text('Finish');
        		        $('.next').removeClass('next');
        		    }
				
				
			}
		})
	}
    
	$(document).on('click', '.next', function(){
	    
	   var status = navigator.onLine;
       if (status) {
    	   var questiofull = $('.valuequestion').text(); 
    	    
    		var question_id = $(this).attr('id');
    		var category_id = $(this).attr('data-cat');
    		$("html, body").animate({ scrollTop: 0 }, "slow");
    		var isChecked = $('.answer_option').is(':checked');
    		if(!isChecked)
    		{
    		    $('.resultmesssage').html('<div class="label label-danger">Please answer all questions to proceed</div>');
    		}else
    		{
    		    
    		    var totalquestion = eval(questiofull)+eval(1);
    		    var categoryquestion = '60';
    		    $('.valuequestion').text(totalquestion);
    		    
    		    $('.resultmesssage').html('');
    		    load_question(question_id,category_id); 
    		   
    		   
    		}
       }else
       {
           Swal.fire({
                  icon: 'error',
                  title: 'Oops...',
                  text: 'No internet Connection !!',
                })
       }
		
		
	});
	
	
	
	
	$(document).on('click', '.finish', function(){
	    var status = navigator.onLine;
        if (status) {
    	    var getcategory = $('.category_id').val();
    	    if(getcategory == 1 || getcategory == 4)
    	    {
    	      var $questions = $("#single_question_area tbody tr");
    	    }else
    	    {
    	        var $questions = $("#single_question_area");  
    	    
    	    }
    	    
            if($questions.find("input:radio:checked").length === $questions.length){
                window.onbeforeunload = null;
                var user_id       = '6011';
              var category_id   = '1';
              
              $.ajax({
